//import { Link, Outlet } from "react-router-dom"; // 스타일을 주기위한 것(사용 안 함)
import character_img from "./character_img.jpg"; // 이미지 불러온 것
import "./M_P.css";
import Daum from "./image/daum.jpg";
import Google from "./image/google.png";
import Kakao from "./image/kakao.png";
import Naver from "./image/naver.png";
import { Link, NavLink } from "react-router-dom"; // 스타일을 주기위한 것

import { useLocation } from "react-router-dom";
//const location = useLocation;
//const using_id = location.state.using_id;

export const TopMenu = () => (
  <nav className="top-menu">
    <NavLink to="/main/Info_modify">정보 수정</NavLink>
    <NavLink to="/main/Schedule">일정</NavLink>
    <NavLink to="/main/Products">상품</NavLink>
  </nav>
);

const check = () => {
  /*
  Axios.post("http://localhost:3000/main", {
    id: "",
    pass: "",
  })
    .then((res) => {
      alert("로그아웃");
    })
    .catch((e) => {
      console.error(e);
    });
*/
  //alert(using_id);
  document.location.href = "/";
};

export const SideMenu = () => (
  <div className="side-menu">
    <div className="info">
      <div className="character">
        <img src={character_img} className="img1" alt="character_img.jpg" />
      </div>
      <div className="nickname">닉네임</div>
      <div className="info-script">
        <div className="introduction">자기소개</div>
        <textarea
          className="introduction-text"
          placeholder="자기소개를 작성하세요"
        ></textarea>
        <br></br>
        <input type="submit" value="수정"></input>
        <input type="submit" value="저장"></input>
      </div>
      <div>
        <input type="submit" value="logout" onClick={check}></input>
      </div>
    </div>
  </div>
  //https://velog.io/@willshowitself/React-%ED%8E%98%EC%9D%B4%EC%A7%80%EB%A5%BC-%EC%9D%B4%EB%8F%99%ED%95%A0-%EB%95%8C-%EB%8D%B0%EC%9D%B4%ED%84%B0%EB%8F%84-%ED%95%A8%EA%BB%98-%EB%84%98%EA%B8%B0%EB%8A%94-%EB%B0%A9%EB%B2%95
);
// sidemenu가 페이지마다 나오게하기 위해 미리 작업
const PageTemplate = ({ children }) => (
  <div className="page">
    <SideMenu />
    {children}
  </div>
);

// 첫 화면(메인 화면) 섹션 편집
export const Main = () => (
  <PageTemplate>
    <section className="main">
      <TopMenu />
      <div>어서오세요</div>
    </section>
  </PageTemplate>
);

// 정보수정부분 섹션 편집
export const Info_modify = () => (
  <PageTemplate>
    <section className="info_modify">
      <TopMenu />
      <div>정보 수정하는 부분</div>
    </section>
  </PageTemplate>
);

// 일정부분 섹션 편집
export const Schedule = () => (
  <PageTemplate>
    <section className="schedule">
      <TopMenu />
      <h1>[Schedule]</h1>
      <p>This area is for schedule</p>
    </section>
  </PageTemplate>
);

// 상품부분 섹션 편집
export const Products = () => (
  <PageTemplate>
    <section className="products">
      <TopMenu />
      <tbody>
        <table>
          <td>
            <a href="https://www.daum.net">
              <img src={Daum} className="product_img" alt="daum.jpg"></img>
              <br></br>
              다음
            </a>
          </td>
          <td>
            <a href="https://www.google.com">
              <img src={Google} className="product_img" alt="google.png"></img>
              <br></br>
              구글
            </a>
          </td>
          <td>
            <a href="https://www.kakaocorp.com/page/">
              <img src={Kakao} className="product_img" alt="kakao.png"></img>
              <br></br>
              카카오
            </a>
          </td>
          <td>
            <a href="https://www.naver.com">
              <img src={Naver} className="product_img" alt="naver.png"></img>
              <br></br>
              네이버
            </a>
          </td>
        </table>
      </tbody>
    </section>
  </PageTemplate>
);

// 화면 전환 시 오류나면 출력
export const Whoops404 = ({ location }) => (
  <div className="whoops-404">
    <h1>Resource not found at '{location.pathname}'</h1>
  </div>
);
